import React, { useEffect } from 'react';
import "./preloader.css"
import { preLoaderAnim } from '../animation';


const Preloader =()=>{

    useEffect(()=>{
        preLoaderAnim();
    },[]);
    return(
        <div className="preloader">
            <div className="text-container">
                <h1>BITKART</h1>
                 
            </div>
        </div>
    )
}
export default  Preloader;
